/**
 * @param {number[]} nums
 * @return {boolean}
 */
var find132pattern = function(nums) {
  var a;
  var b;
  var c;
  for( var i = 0, len = nums.length; i < len; i++){
    a = nums[i];
    for(var j = i+1; j < len; j ++ ){
      b = nums[j];
      if( b > a + 1 ){
        for(var k = j + 1; k < len; k ++ ){
          c = nums[k];
          if( c > a && c < b ){
            return true;
          }
          if( c >= b ){
            b = c;
            j = k;
          }
        } 
      } else if( j === i + 1 && b <= a ){
        a = b;
        i ++;
      }
    }
  }

  return false;
};


